# Fun√ß√£o para calcular o delta E com todos os componentes
def delta_e(lab1, lab2):
    L1, a1, b1, C1, h1 = lab1
    L2, a2, b2, C2, h2 = lab2

    # Calcular as diferen√ßas ao quadrado
    delta_L = (L1 - L2) ** 2
    delta_a = (a1 - a2) ** 2
    delta_b = (b1 - b2) ** 2
    delta_C = (C1 - C2) ** 2
    delta_h = (h1 - h2) ** 2

    # Calcular o delta E
    delta_e = math.sqrt(delta_L + delta_a + delta_b + delta_C + delta_h)

    return delta_e

